import React from 'react';
// import './ToolTip.css';

function ToolTip(props) {
  const gifUrl = props.details.gif;

  console.log(gifUrl)

  return (
    <div className="Overlay">
      <img src={`${gifUrl}`}/>
    </div>
  );
}

export default ToolTip;
